// SPDX-License-Identifier: MIT
pragma solidity ^0.7.0;

import "../node_modules/@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721Holder.sol";
// import "./ChiGasSaver.sol";
import "./Resolver.sol";

contract RentNft is ReentrancyGuard, Ownable, ERC721Holder {
  using SafeERC20 for IERC20;

  // 256 bits -> 32 bytes
  // address - 20 byte value -> 160 bits
  uint32 private constant SECONDS_IN_A_DAY = 86400;
  uint256 private id = 1;
  Resolver private resolver;

  event Lent(
    address indexed nftAddress,
    uint256 indexed tokenId,
    uint256 lendingId,
    address indexed lenderAddress,
    uint16 maxRentDuration,
    uint32 dailyRentPrice,
    uint32 nftPrice,
    PaymentToken paymentToken
  );

  event Rented(
    address indexed nftAddress,
    uint256 indexed tokenId,
    uint256 lendingId,
    address indexed renterAddress,
    uint16 rentDuration,
    uint32 rentedAt
  );

  event Returned(
    address indexed nftAddress,
    uint256 indexed tokenId,
    uint256 indexed lendingId,
    address renterAddress,
    uint32 returnedAt
  );

  event CollateralClaimed(
    address indexed nftAddress,
    uint256 indexed tokenId,
    uint256 indexed lendingId,
    uint32 claimedAt
  );

  event LendingStopped(
    address indexed nftAddress,
    uint256 indexed tokenId,
    uint256 indexed lendingId,
    uint32 stoppedAt
  );

  struct Lending {
    // 160 bits
    address lenderAddress;
    // 176 bits
    uint16 maxRentDuration;
    // 208 bits
    uint32 dailyRentPrice;
    // 240 bits
    uint32 nftPrice;
    // 248 bits
    PaymentToken paymentToken;
  }

  struct Renting {
    // 160 bits
    address renterAddress;
    // 176 bits
    uint16 rentDuration;
    // 198 bits
    uint32 rentedAt;
  }

  struct LendingRenting {
    Lending lending;
    Renting renting;
  }

  enum PaymentToken {
    DAI, // 0
    USDC, // 1
    USDT, // 2
    TUSD, // 3
    ETH, // 4
    UNI, // 5
    YFI, // 6
    NAZ // 7
  }

  // 32 bytes key to 64 bytes struct
  mapping(bytes32 => LendingRenting) private lendingRenting;

  constructor(Resolver _resolver) {
    resolver = _resolver;
  }

  function lendOne(
    IERC721 _nftAddress,
    uint256 _tokenId,
    uint16 _maxRentDuration,
    uint32 _dailyRentPrice,
    uint32 _nftPrice,
    PaymentToken _paymentToken,
    address payable _gasSponsor
  ) public nonReentrant {
    require(_maxRentDuration > 0, "at least one day");

    // edge-cases analysis
    // 1. if I have lent out and try to lend out again. fail: since the nft was already transferred

    // 120k gas ...
    _nftAddress.safeTransferFrom(msg.sender, address(this), _tokenId);

    LendingRenting storage item = lendingRenting[keccak256(
      abi.encodePacked(address(_nftAddress), _tokenId, id)
    )];

    // 29.7k gas
    item.lending = Lending({
      lenderAddress: msg.sender,
      maxRentDuration: _maxRentDuration,
      dailyRentPrice: _dailyRentPrice,
      nftPrice: _nftPrice,
      paymentToken: _paymentToken
    });

    emit Lent(
      address(_nftAddress),
      _tokenId,
      id,
      msg.sender,
      _maxRentDuration,
      _dailyRentPrice,
      _nftPrice,
      _paymentToken
    );

    // changing from non-zero to something else costs 5000 gas
    // however, changing from zero to something else costs 20k gas
    id++;
  }

  function lendMultiple(
    IERC721[] calldata _nftAddresses,
    uint256[] calldata _tokenIds,
    uint16[] calldata _maxRentDurations,
    uint32[] calldata _dailyRentPrice,
    uint32[] calldata _nftPrices,
    PaymentToken[] calldata _paymentTokenAddresses,
    address payable[] calldata _gasSponsors
  ) external {
    for (uint256 i = 0; i < _nftAddresses.length; i++) {
      lendOne(
        _nftAddresses[i],
        _tokenIds[i],
        _maxRentDurations[i],
        _dailyRentPrice[i],
        _nftPrices[i],
        _paymentTokenAddresses[i],
        _gasSponsors[i]
      );
    }
  }

  function rentOne(
    IERC721 _nftAddress,
    uint256 _tokenId,
    uint256 _id,
    uint16 _rentDuration,
    address _gasSponsor
  ) public nonReentrant {
    // edge-cases analysis
    // 1. what if I rent, immediately lend, and immediately borrow from myself
    // - rent and lend steps will work with no issue; last rent step will fail
    // - this is because we have a require here that the currentLender != msg.sender
    // 2. acc A lends, acc B rents, acc B lends with maxDuration higher than original
    // - TODO: this is currently allowed, I strongly believe it should not be. Since this
    // increaes the risk of the platform

    LendingRenting storage item = lendingRenting[keccak256(
      abi.encodePacked(address(_nftAddress), _tokenId, _id)
    )];

    require(item.renting.rentDuration == 0, "already rented");

    // ! this means that you can rent your own NFT and purposefully avoid returning it
    // ! do we want such a mechanic?
    // ! currentLender may not be you, but you may be the original lender, so this
    // ! check would pass and so you could rent your own NFT
    // ! if the new lender set a lower collateral, then your profit would be
    // ! original collateral - borrow payments - current collateral
    // ! we should leave this in, because this would incentivise the new lenders
    // ! to consider the original quotes when setting their collateral, etc.
    require(msg.sender != item.lending.lenderAddress, "can't rent own nft");
    require(
      _rentDuration <= item.lending.maxRentDuration,
      "max duration exceeded"
    );

    // TODO: this should go to the contract as an escrow
    // on return, or on collateral claim, we either give
    // the lender the portion of the amounts, or all of them
    uint256 rentPrice = _rentDuration *
      _unpackPrice(bytes4(item.lending.dailyRentPrice));
    IERC20 paymentToken = resolver.getPaymentToken(
      uint8(item.lending.paymentToken)
    );

    paymentToken.safeTransferFrom(
      msg.sender,
      item.lending.lenderAddress,
      rentPrice
    );
    paymentToken.safeTransferFrom(
      msg.sender,
      address(this),
      _unpackPrice(bytes4(item.lending.nftPrice))
    );

    uint32 rentedAt = uint32(block.timestamp);

    item.renting.renterAddress = msg.sender;
    item.renting.rentDuration = _rentDuration;
    item.renting.rentedAt = rentedAt;

    _nftAddress.safeTransferFrom(address(this), msg.sender, _tokenId);

    emit Rented(
      address(_nftAddress),
      _tokenId,
      _id,
      msg.sender,
      _rentDuration,
      rentedAt
    );
  }

  function rentMultiple(
    IERC721[] calldata _nftAddress,
    uint256[] calldata _tokenId,
    uint256[] calldata _id,
    uint16[] calldata _rentDuration,
    address payable[] calldata _gasSponsors
  ) external {
    for (uint256 i = 0; i < _nftAddress.length; i++) {
      rentOne(_nftAddress[i], _tokenId[i], _id[i], _rentDuration[i], _gasSponsors[i]);
    }
  }

  function returnOne(
    IERC721 _nftAddress,
    uint256 _tokenId,
    uint256 _id,
    address _gasSponsor
  ) public nonReentrant {
    LendingRenting storage item = lendingRenting[keccak256(
      abi.encodePacked(address(_nftAddress), _tokenId, _id)
    )];
    require(item.renting.renterAddress == msg.sender, "not renter");
    uint16 durationInDays = uint16((block.timestamp - item.renting.rentedAt) /
      SECONDS_IN_A_DAY);
    require(durationInDays <= item.renting.rentDuration, "duration exceeded");

    _nftAddress.safeTransferFrom(msg.sender, address(this), _tokenId);

    IERC20 paymentToken = resolver.getPaymentToken(
      uint8(item.lending.paymentToken)
    );
    paymentToken.safeTransfer(
      msg.sender,
      _unpackPrice(bytes4(item.lending.nftPrice))
    );

    emit Returned(address(_nftAddress), _tokenId, _id, msg.sender, uint32(block.timestamp));

    delete item.renting;
  }

  function returnMultiple(
    IERC721[] calldata _nftAddress,
    uint256[] calldata _tokenId,
    uint256[] calldata _id,
    address payable[] calldata _gasSponsors
  ) external {
    for (uint256 i = 0; i < _nftAddress.length; i++) {
      returnOne(_nftAddress[i], _tokenId[i], _id[i], _gasSponsors[i]);
    }
  }

  function claimCollateralOne(
    IERC721 _nftAddress,
    uint256 _tokenId,
    uint256 _id,
    address _gasSponsor
  ) public nonReentrant {
    LendingRenting storage item = lendingRenting[keccak256(
      abi.encodePacked(address(_nftAddress), _tokenId, _id)
    )];

    require(item.renting.rentDuration != 0, "nft not rented out");
    require(item.lending.lenderAddress == msg.sender, "not lender");

    uint16 durationInDays = uint16((block.timestamp - item.renting.rentedAt) /
      SECONDS_IN_A_DAY);

    require(
      durationInDays > item.renting.rentDuration,
      "duration not exceeded"
    );

    IERC20 paymentToken = resolver.getPaymentToken(
      uint8(item.lending.paymentToken)
    );
    paymentToken.safeTransfer(
      msg.sender,
      _unpackPrice(bytes4(item.lending.nftPrice))
    );

    delete item.lending;
    delete item.renting;

    emit CollateralClaimed(address(_nftAddress), _tokenId, _id, uint32(block.timestamp));
  }

  function claimCollateralMultiple(
    IERC721[] calldata _nftAddress,
    uint256[] calldata _tokenId,
    uint256[] calldata _id,
    address payable[] calldata _gasSponsors
  ) external {
    for (uint256 i = 0; i < _nftAddress.length; i++) {
      claimCollateralOne(_nftAddress[i], _tokenId[i], _id[i], _gasSponsors[i]);
    }
  }

  function stopLendingOne(
    IERC721 _nftAddress,
    uint256 _tokenId,
    uint256 _id,
    address _gasSponsor
  ) public {
    LendingRenting storage item = lendingRenting[keccak256(
      abi.encodePacked(_nftAddress, _tokenId, _id)
    )];

    require(item.renting.rentDuration == 0, "nft rented currently");
    require(item.lending.lenderAddress == msg.sender, "not lender");

    IERC721(_nftAddress).safeTransferFrom(address(this), msg.sender, _tokenId);

    delete item.lending;

    emit LendingStopped(address(_nftAddress), _tokenId, _id, uint32(block.timestamp));
  }

  function stopLendingMultiple(
    IERC721[] calldata _nftAddress,
    uint256[] calldata _tokenId,
    uint256[] calldata _id,
    address payable[] calldata _gasSponsors
  ) external {
    for (uint256 i = 0; i < _nftAddress.length; i++) {
      stopLendingOne(_nftAddress[i], _tokenId[i], _id[i], _gasSponsors[i]);
    }
  }

  // We can't use uint256 for prices in the struct because
  // we must fit our struct in a single 32 byte chunk.
  // Since, no-one in their right mind will ever pay
  // $65k to rent an NFT for a single day, we have
  // set up this constraint on the prices that they
  // both are uint32. It is possible we may use
  // uint40 for collateral and uint24 for dailyRentPrice.
  // Anyhow, this constraint helps save us some extra 40k
  // in gas, that you dear lender and reader would pay.
  // So working under this constraints, the first 4 hexbytes
  // of the packed price contain the whole number information,
  // whereas the last 4 bytes represent the decimal portion
  // ! assumes 18 decimal places !
  // TODO: not the most efficient way of packing. Operating on
  // the bit level would allow us to give some extra precision
  // for the whole part. We are only using about 1/6th of the space
  // available for the decimal part. Our decimal part spans from 0 to 9999
  // but we have extra 65535 - 9999 numbers that could be used in the
  // whole part! Potentially, making the maximum 65535 + 65535 - 9999 = 
  // 120000 + 11070 - 10000 + 1 = 120000 + 1071 = 121071
  // ----- Examples
  // 0x000f000f is 16.0016
  // 0x001f0001 is 17.0001
  // ----- Constraints
  // The maximum whole number is therefore 65535
  // The maximum decimal is 0.9999
  // Therefore the prices can be in [0, 65535.9999]
  function _unpackPrice(bytes4 _price) internal pure returns (uint256) {
    bytes2 who = bytes2(_price);
    bytes2 dec = bytes2(_price << 16);

    uint16 whole = uint16(who);
    uint16 decimal = uint16(dec);

    uint256 w = uint256(whole) * 1e18;

    if (decimal > 9999) {
      decimal = 9999;
    }

    bool find = true;
    uint16 divisor = 10;
    uint16 res = 1;

    while (find) {
      res = decimal / divisor;
      if (res == 0) {
        find = false;
      } else {
        divisor *= 10;
      }
    }

    uint256 d = decimal * (1e18 / uint256(divisor));

    uint256 price = d + w;

    return price;
  }
}
